	/* Statutory Contribution Progression*/ 
	MandContriEffDate,
	MandContriCareerId, 
	MandContriPolicyId, 
	MandContriCurrent,
	MandContriRemarks,
	MandContriSchemeId
	)
	Select CurProg.EmployeeSysId, 
	'2019-04-01', 
	'None',
	'SSSYr2019Apr', 
	0,
	'',
	'SSS'
	From PayEmployee PE join MandatoryContributeProg CurProg
	On PE.EmployeeSysId = CurProg.EmployeeSysId
	Left Join MandatoryContributeProg NewProg ON CurProg.EmployeeSysId = NewProg.EmployeeSysId and CurProg.MandContriSchemeId = NewProg.MandContriSchemeId 
	     and NewProg.MandContriEffDate = '2019-04-01'
	Where CurProg.MandContriCurrent = 1 and CurProg.MandContriEffDate < '2019-04-01' and CurProg.MandContriSchemeId = 'SSS' and CurProg.MandContriSchemeId != ''
	And NewProg.EmployeeSysId is null
	And (PE.LastPayDate = '1899-12-30' Or PE.LastPayDate >= '2019-04-01');


	/* Update progression if progression’s effective date is equal or greater than 2019-04-01, scheme is not blank & policy is SSSYr2014Jan */
	Update MandatoryContributeProg
	Set MandContriPolicyId = 'SSSYr2019Apr'
	Where MandContriEffDate >= '2019-04-01' 
	AND MandContriPolicyId = 'SSSYr2014Jan' And MandContriSchemeId = 'SSS'
	AND MandContriSchemeId != '';
